import React, { Component } from "react";
import LoginPresenter from "./LoginPresenter";

class LoginContainer extends Component {
  constructor(props) {
    super(props);
    const {
      location: { pathname }
    } = props;
    this.state = {
      id: pathname
    };
    console.log(this.state.id);
  }
  render() {
    return <LoginPresenter />;
  }
}

export default LoginContainer;
